    $('td:contains("Hungary")').each(function() {
        $(this).closest('tr').css('background', 'rgb(255 61 0 / 40%)');
    });
	
	$('th').each(function() {
        var text = $(this).text().trim();

        // Töröljük a szöveget, ha az "No.", "Team", "Res", vagy ":"
        if (text === "No." || text === "Team" || text === "Res." || text === "Rk." || text === ":") {
            $(this).text('');
        }

        // Ha a szöveg "Pts.", akkor átírjuk "Pontok"-ra
        if (text === "Pts.") {
            $(this).text('Pont');
        }
		if (text === "+") {
            $(this).text('W');
        }
		if (text === "=") {
            $(this).text('D');
        }
		if (text === "-") {
            $(this).text('L');
        }
		
    });
	
	$('td').each(function() {
		var html = $(this).html(); // Lekérjük az aktuális td tartalmát, beleértve a HTML-t is, ha van.

		// Lecseréljük az összes ½ karaktert ,5-re a szövegben
		var newHtml = html.replace(/½/g, ',5');

		// Frissítjük az aktuális td tartalmát a módosított szöveggel
		$(this).html(newHtml);

		// Ellenőrizzük, hogy az elem értéke pontosan ",5"-e, és ha igen, akkor lecseréljük "0,5"-re
		if ($(this).text().trim() === ",5") {
			$(this).text("0,5");
		}
	});

