// Hungary sor átrendezése
function moveHungary(selector, tableClass, targetIndex) {
    $(selector).each(function() {
        var text = $(this).text().trim();

        if (text === "Hungary") {
            var $tr = $(this).closest('tr');
            var rowIndex = $tr.index();

            if (rowIndex > targetIndex) {
                $tr.insertBefore($(tableClass + ' tr').eq(targetIndex + 1));
            }
        }
    });
}

// Hungary B sor átrendezése
