// Általános függvény a Hungary B és Hungary C sorok ellenőrzésére és esetleges cseréjére
function swapHungaryBAndCByFirstColumn(tableClass) {
    var hungaryBRow = $(tableClass + " td:contains('Hungary B')").closest('tr');
    var hungaryCRow = $(tableClass + " td:contains('Hungary C')").closest('tr');

    // Ellenőrizze, hogy mindkét sor létezik
    if (hungaryBRow.length > 0 && hungaryCRow.length > 0) {
        // Első oszlop értékének lekérése Hungary B és Hungary C sorokhoz
        var hungaryBValue = parseInt(hungaryBRow.find('td').first().text().trim(), 10);
        var hungaryCValue = parseInt(hungaryCRow.find('td').first().text().trim(), 10);

        // Console log: Hungary B és Hungary C első oszlop értékei
        console.log("Hungary B első oszlop értéke (" + tableClass + "): " + hungaryBValue);
        console.log("Hungary C első oszlop értéke (" + tableClass + "): " + hungaryCValue);

        // Ellenőrizze, hogy a Hungary C értéke kisebb-e, mint a Hungary B-é
        if (hungaryCValue < hungaryBValue) {
            hungaryCRow.insertBefore(hungaryBRow);
        } 
    }
}

// Végigmegyünk mind a négy táblázaton és ellenőrizzük a Hungary B és Hungary C sorokat
swapHungaryBAndCByFirstColumn('#open .rounds');
