   <script>
$(document).ready(function() {
    function updateCountdown() {
        // Jelenlegi idő lekérése
        var now = new Date();
        
        // Cél időpont beállítása (14:55 CEST minden nap)
        var targetTime = new Date();
        targetTime.setHours(11, 00, 0, 0); // 14:55:00

        // Ha a célidőpont már elmúlt, ne indítsuk újra, csak éjfélkor
        if (now > targetTime) {
            $('#countdown').text(""); // Üres, ha a célidőpont elmúlt
            return; // Megállítjuk a visszaszámlálást
        }

        // Különbség kiszámítása milliszekundumban
        var diff = targetTime - now;

        // Átváltás másodpercre, percre, órára
        var hours = Math.floor(diff / (1000 * 60 * 60));
        var minutes = Math.floor((diff % (1000 * 60 * 60)) / (1000 * 60));
        var seconds = Math.floor((diff % (1000 * 60)) / 1000);

        // Formázás: ha az óra, perc vagy másodperc < 10, hozzáadunk egy 0-t
        if (hours < 10) {
            hours = '0' + hours;
        }

        if (minutes < 10) {
            minutes = '0' + minutes;
        }

        if (seconds < 10) {
            seconds = '0' + seconds;
        }

        // Kijelzés a visszaszámlálásra
        $('#countdown').text(hours + ':' + minutes + ':' + seconds);
    }

    // Funkció az éjfél ellenőrzésére és az újraindításra
    function checkMidnight() {
        var now = new Date();
        if (now.getHours() === 0 && now.getMinutes() === 0 && now.getSeconds() === 0) {
            // Éjfél van, újraindítjuk a visszaszámlálást
            updateCountdown();
        }
    }

    // Visszaszámlálás indítása
    var timer = setInterval(updateCountdown, 1000);

    // Éjfél ellenőrzése
    setInterval(checkMidnight, 1000);
});

</script>             


